            "candidate": "Ad5-nCoV",
            "mechanism": "Recombinant vaccine (adenovirus type 5 vector)",
            "sponsors": [
                "CanSino Biologics"
            ],
            "details": "Background: China&rsquo;s CanSino Biologics has developed a recombinant novel coronavirus vaccine that incorporates the adenovirus type 5 vector (Ad5). Preliminary safety data from a Phase 1 (ChiCTR2000030906; NCT04313127) clinical trial of 108 participants between 18 and 60 years old who will receive low, medium, and high doses of Ad5-nCoV has allowed the company to plan to initiate a Phase 2 trial, according to an announcement. The Phase 2 (ChiCTR2000031781) trial has identical inclusion criteria. Outcomes: A single dose of Ad5-nCoV protected against upper respiratory infection of SARS-CoV-2 in ferrets, according to a paper published 14 August in Nature Communications. Results from the Phase 1 trial show a humoral and immunogenic response to the vaccine, according to a paper published in The Lancet. Adverse reactions such as pain (54%), fever (46%), fatigue (44%), headache (39%), and muscle pain (17%) occurred in 83% of patients in the low and medium dose groups and 75% of patients in the high dose group. In the Phase 2 trial, neutralizing antibodies and specific interferon γ enzyme-linked immunospot assay responses were observed at all dose levels for most participants. Status: On 25 June, China’s Central Military Commission announced the military had been approved to use Ad5-nCoV for a period of 1 year, according to reporting in Reuters. The Phase 3 trial is underway at sites in Saudi Arabia and Russia.",
            "trialPhase": "Phase 3",
            "institutions": [
                "Tongji Hospital",
                "Wuhan, China"
            ]
        },
        {
            "candidate": "AZD1222",
            "mechanism": "Replication-deficient viral vector vaccine (adenovirus from chimpanzees)",
            "sponsors": [
                "The University of Oxford",
                "AstraZeneca",
                "IQVIA",
                "Serum Institute of India"
            ],
            "details": "Background: AstraZeneca and the Oxford Vaccine Group at the University of Oxford are developing AZD1222 (previously ChAdOx1), a chimpanzee adenovirus vaccine. The team has previously developed a MERS vaccine. In India, the candidate is being jointly developed by the Serum Institute of India and AstraZeneca, and goes by the name Covishield. Preclinical data on the pre-print server bioRxiv showed a significantly reduced viral load and &ldquo;humoral and cellular immune response.&rdquo; Another pre-print paper showed an immune response in mice and pigs. Study Designs: A Phase 1/2 (NCT04324606) single-blinded, multi-center study of 1,090 healthy adult volunteers aged 18-55 years with four treatment arms. A Phase 3 trial (NCT04516746), for which AstraZeneca released the clinical study protocol, is underway and aims to enroll up to 30,000 participants. An inhaled version of the vaccine candidate is being tested in a small trial of 30 people. Outcomes: Preliminary results from the trial published in The Lancet showed the vaccine candidate had an &ldquo;acceptable safety profile&rdquo; with most patients demonstrating an antibody response after one dose and all patients showing a response after two doses. Status: The AstraZeneca trials are funded in part by BARDA and Operation Warp Speed. IQVIA&nbsp;announced&nbsp;they are partnering with AstraZeneca to advance clinical trials for the vaccine. Phase 3 trials are being conducted in the&nbsp;United States&nbsp;and in&nbsp;study sites&nbsp;in India, but were put on hold following a serious adverse event. While trials have resumed in most countries, the FDA has not allowed them to resume in the US. Further, the agency has broadened its&nbsp;safety inquiry into AZD1222 to include data from similar vaccines, Reuters reported on 30 September. EMA&rsquo;s human medicines committee (CHMP) has&nbsp;started&nbsp;a rolling revivew of AZD1222 to reduce the amount of time before a decision is made on safety and effectiveness, as has Health Canada.",
            "trialPhase": "Phase 3",
            "institutions": [
                "The University of Oxford,&nbsp",
                "the Jenner Institute"
            ]
        },
        {
            "candidate": "CoronaVac",
            "mechanism": "Inactivated vaccine (formalin with alum adjuvant)",
            "sponsors": [
                "Sinovac"
            ],
            "details": "Background: CoronaVac (formerly PiCoVacc) is a formalin-inactivated and alum-adjuvanted candidate vaccine. Results from animal studies showed &ldquo;partial or complete protection in macaques&rdquo; exposed to SARS-CoV-2, according to a&nbsp;paper&nbsp;published by researchers in the journal&nbsp;Science.  Study Design: A Phase 1/2 trial enrolled 743 healthy volunteers (18-59 years old) who received two different dosages of the vaccine or placebo. There were 143 participants in Phase 1 (NCT04352608) and 600 participants in Phase 2 (NCT04383574).  Outcomes: Results from the Phase 1/2 trials posted to the pre-print server medRxiv indicate the vaccine has good safety and immunogenicity, with 92.4% of participants receiving the 3 μg dose on a 0-14 day schedule and 97.4% of individuals receiving the dose on a 0-28 day schedule achieving seroconversion.  Status: Sinovac said a Phase 3 trial in collaboration with Instituto Butantan in Brazil is underway, and the company plans to enroll around 9,000 patients in the healthcare industry. Another trial is underway in Turkey. Representatives from Sinovac told Reuters that the vaccine appeared to be safe in older trial participants, and did not cause any severe side effects.",
            "trialPhase": "Phase 3",
            "institutions": [
                "Sinovac Research and Development Co., Ltd."
            ]
        },
        {
            "candidate": "JNJ-78436735 (formerly Ad26.COV2-S)",
            "mechanism": "Non-replicating viral vector",
            "sponsors": [
                "Johnson & Johnson"
            ],
            "details": "Background: Johnson & Johnson is developing a COVID-19 vaccine, JNJ-78436735 (formerly known asd Ad26.COV2-S), using their AdVac and PER.C6 systems, which were also used to develop the company's Ebola vaccine. The work is being done in J&J's Janssen Pharmaceuticals division. In partnership with BARDA, J&J has committed to investing more than $1 billion in vaccine research and development. JNJ-78436735 is a part of Operation Warp Speed.  Study Design: A randomized, double-blind, placebo-controlled, Phase 1/2a study of recombinant JNJ-78436735 in 1,045 healthy participants 18-55 years of age, and adults 65 years or older. Study sites are planned in the U.S. and Belgium (NCT04436276). The Phase 3 ENSEMBLE trial will enroll up to 60,000 participants in the United States and internationally (NCT04505722). On 23 September, J&J released the study protocol for the ENSEMBLE trial. Outcomes: Results from the Phase 1/2a study in humans posted to the pre-print server MedRxiv found a single dose of the vaccine showed immunogenicity and a good safety profile. In animal studies, researchers reported in a paper published in Nature that a single injection of JNJ-78436735 \"induced robust neutralizing antibody responses and provided complete or near-complete protection in bronchoalveolar lavage and nasal swabs following SARS-CoV-2 challenge,\" in rhesus macaques, while another paper published in Nature Medicine indicated the vaccine protected against severe disease when tested in hamsters. Status: On 10 June, J&J announced it is accelerating Phase 1/2 trials and human trials are underway. The Phase 3 trial, expected to enroll up to 60,000 people, is also underway, according to the company.  Funding: JNJ-78436735 is  funded by Janssen, BARDA, NIAID and Operation Warp Speed. ",
            "trialPhase": "Phase 3",
            "institutions": [
                "Johnson & Johnson"
            ]
        },
        {
            "candidate": "mRNA-1273",
            "mechanism": "mRNA-based vaccine",
            "sponsors": [
                "Moderna"
