hospitalized with COVID-19 and given convalescent plasma, the &ldquo;optimal window&rdquo; for administration was within 44 hours, according to a paper of 60-day follow-up data posted to medRxiv.   Regulatory actions: &nbsp;On 23 August, FDA issued an EUA for the use of convalescent plasma for patients hospitalized with suspected or laboratory-confirmed COVID-19. The EUA decision was based on convalescent plasma&rsquo;s history of effectiveness in other coronaviruses, efficacy and safety data in animal models, published studies on safety and efficacy in humans, and data from the National Expanded Access Treatment Protocol led by the Mayo Clinic. However, to date, there has been no data from large-scale randomized clinical trials on the safety and efficacy of convalescent plasma. In a fact sheet issued to providers, FDA emphasized that convalescent plasma is not standard of care for COVID-19, and changes should not be made to current clinical trials of convalescent plasma based on the EUA. FDA previously had allowed the use of convalescent plasma from recovered cases of COVID-19 for patients with &ldquo;serious or immediately life-threatening COVID-19 infections under an&nbsp;emergency investigational new drug&nbsp;(eIND) application.&rdquo; On 23 September, FDA reaffirmed their decision to issue an EUA for convalescent plasma, saying it &ldquo;met the criteria for issuance of an EUA&rdquo; but clarified that convalescent plasma does not meet &ldquo;the same evidentiary standard as required for approval or licensure of a drug or biological product.&rdquo;",
